import React from 'react';

const ImageDisplay = ({ imageSrc }) => {
    return (
        <div>
            <h2>Uploaded Image</h2>
            <img src={imageSrc} alt="A description of the specific content or context of the image" />
        </div>
    );
};

export default ImageDisplay;
